import React from 'react';

import Container from 'react-bootstrap/Container';
import Image from 'react-bootstrap/Image'
import Nav from 'react-bootstrap/Nav'
import Navbar from 'react-bootstrap/Navbar'
import NavDropdown from 'react-bootstrap/NavDropdown'
import Card from 'react-bootstrap/Card'
import Button from 'react-bootstrap/Button'
import Dropdown from 'react-bootstrap/Dropdown'
import CardGroup from 'react-bootstrap/CardGroup'
import Toast from 'react-bootstrap/Toast'
import Carousel from 'react-bootstrap/Carousel'
import ToastContainer from 'react-bootstrap/ToastContainer'

import 'bootstrap/dist/css/bootstrap.min.css';
import {
  BrowserRouter,
  Routes,
  Route,
  Link,
  Outlet
} from "react-router-dom";

class viewCats extends React.Component {

    constructor(props) {
      super(props);
      this.state = {
        chatList: []
      };

    } 

    componentDidMount() {
      Axios.get('http://localhost:8000/chats')
      .then((response) => {
        console.log(response.data);
        console.log(response.status);
        console.log(response.statusText);
        console.log(response.headers);
        console.log(response.config);
        this.setState({chatList: response.data})
      });
    }

    render() {
      return(
        <div className="container start" style={{maxWidth: "100%",maxHeight:"100%"}}>
            <Link to="/administration" class="link-light">  <Button variant="warning">Administration</Button> </Link>
          <CardGroup>
          {this.state.chatList.map((item, i) => (
            <Card key={i} className="mx-2">
              <Card.Img variant="top" src={item.photo} />
              <Card.Body>
                <Card.Title>{item.name}</Card.Title>
                <Card.Text>{item.description}</Card.Text>
              </Card.Body>
              <Card.Footer>
                <small className="text-muted">Prix {item.price} euros </small>
                <small className="text-muted">Taille {item.size} </small>
                <small className="text-muted">Cat√©gorie {item.categorie} </small>
              </Card.Footer>
            </Card>
          ))}   
          </CardGroup>
        </div>
      );
    }
  }

export default viewCats;
